import React from 'react'

import card from '../Card/card'

export default props => {
 const deck = props.deckData;
  return(
    <>
      <section className="deck">
        <header><h2>{deck.title}</h2></header>

        {deck.records.map( (card) =>
          <card cardData = {card} />
        )}
       </section>
    </>
      )
    };
